const getBlogs = async () => {

    try {
        const res = await fetch("https://ix-blog-app-2d5c689132cd.herokuapp.com/", 
            { 
                method: "GET", 
                headers: {
                    "Content-Type": "application/json"
                }
            }
        );
        const blogsApiData = await res.json();
        return blogsApiData.data;
    } catch (err) {
        throw new Error(err);
    }
};

const blogService = {
    getBlogs
}

export default blogService;
